window.bookSummaryJSON = "<p><b><i>The Secret Life of Pets</i></b><b> meets </b><b><i>Toy Story</i></b><b> in a new middle-grade series, adapted for audio, about a group of Very Good doggie day care buddies who follow a few of their wilder instincts, leading to hilarious chaos.</b></p> <p>Meet Hugo: the loyal and lovable family dog that would do just about anything to keep his owners happy. A very Good Dog, all of the time.</p> <p>Meet King: the newest puppy in town! Always full of energy and ready to make new friends, King is still learning the ropes of how to be a Good Dog.</p> <p>Meet Lulu: Lights! Camera! Action! Lulu is an Instagram star with an affinity for all things fancy - make sure her fur and collar look perfect in that photo! Always a Good Dog, especially with her owner Jasmine.</p> <p>When these three doggy day care pals come together for an unlikely adventure away from their owners, a small taste of being just a little bit bad starts a hilarious series of events none of them saw coming!</p> <p>This new middle-grade series follows a group of dogs that quickly steal your heart - and make you hope your furry friends don't get any of their own ideas!</p>"; 
